import React from "react";
import picture from './zz.png';
import './App.css';


function App() {
  const [a, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("http://localhost:3001/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <img class="pic" src={picture} className="picture" alt="pic" />
        <h1>
          holy moly
        </h1>
        <form name="quoteEntry">
          <label for="quote">im malding i cant figure out backend what do i do</label><br></br>
          <input class="quoteEntry" type="text" placeholder="quote" name="quote" />
          <input class="submit" type="submit" value="submit" />
        </form>
        <p>
          {!a? "ur mom" : a}
        </p>
      </header>
    </div>
  );
}

export default App;
